import { Button } from "antd";
import { SlidingDiv,UsersDiv,SocialShareHeading,SocialShareFacebook, AutopostDiv } from "./Component";
import { useState } from "react";
import { CheckOutlined, CloseOutlined } from '@ant-design/icons';
import { Switch, Space } from 'antd';
const SocialDiv = () => {
    const data = [
        { id: 1, name: 'Item 1', quantity: 5 },
        { id: 2, name: 'Item 2', quantity: 8 },
        { id: 3, name: 'Item 3', quantity: 3 }
      ];
    const userData=[{
        name:"kuberan"
    }]
    const [SlideStyle,setSlideStyle]=useState("right:-100")
    return ( 
        <UsersDiv>
             {userData.map(user => (
          <li key={user.name}> {user.name} <button>change</button> </li>  ))}
            <SlidingDiv>
                <SocialShareHeading>Social Share Setting</SocialShareHeading>
                <SocialShareFacebook>
                    <AutopostDiv><Switch
                        checkedChildren={<CheckOutlined />}
                        unCheckedChildren={<CloseOutlined />}
                        defaultChecked/>
                     </AutopostDiv>
                </SocialShareFacebook>
            </SlidingDiv>

        </UsersDiv>
     );
}

export default SocialDiv;
